/**
 * Determines the orientation of an operation.
 *
 * @private
 */
enum Orientation {
	/**
	 * @private
	 */
	Vertical = "Vertical",

	/**
	 * @private
	 */
	Horizontal = "Horizontal",
}

export default Orientation;
